Based on the stories of surrealist writer Gyula Krudy, this iconic film is a
lush and sensuous depiction of the life, loves and memories of serial seducer
Szindbad (Zoltan Latinovits).
As Szindbad contemplates his life of hedonism and romance, the film powerfully
evokes the passage of time and the exploration of memory through extraordinarily
beautiful imagery.  An erotic elegy, at once lyrical and surreal, Szindbad is a
work of intoxicating, almost overwhelming physical beauty.

